import React from "react"
import API from "../components/file"

const Home = () => {
  return (
    <div>
      {API.map((item) => (
        <div key={item.voice_id}>
          <ul>
            <li>{item.voice_id}</li>
            <li>{item.callDuration}</li>
          </ul>
        </div>
      ))}
    </div>
  )
}

export default Home
